/**
 * @class Language
 * @author Rafal Cymbalsita
 * @param {String} language
 */
export default class Language {
   /**
    * @public
    * @constructor
    * @param {String} language
    */
   constructor(language) {
      this.language = language;
   }
   /**
    * @public
    * @returns {Language} DTO
    */
   getLanguageDTO() {
      return { language: { language: this.language } };
   }
}
